/**
 * Code generated using Python
 * @author Raja Reddy
 * Date : 17 Oct 2021
 *
 * Modified By : 
 */

import { useState, useEffect } from "react";
import { withRouter, useParams, useHistory } from "react-router-dom";
import { useForm } from "react-hook-form";
import axios from 'axios';
import * as yup from "yup";

import { yupResolver } from '@hookform/resolvers/yup';
import LiveSearch from '../utils/LiveSearch';

//import DatePicker  from 'react-datepicker';
//import "react-datepicker/dist/react-datepicker.css";
//import addDays from 'date-fns/addDays'

import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'

const schema = yup.object({


});



const RbsTransEdit = () => {
	const { register, handleSubmit, setValue, formState: { errors }, clearErrors } = useForm({
		resolver: yupResolver(schema)
	});

	let { id } = useParams();

	let history = useHistory();
	const [serverErrors, setServerErrors] = useState([]);
	const [entity, setEntity] = useState({});
	const [state, setState] = useState({}); 
	const [key, setKey] = useState('page1');

	const [dakId, setDakId] = useState(0);

	const [mesg,setMesg]=useState('');
	const [me,setMe]=useState('');
	const [dakidNo,setDakidNo]=useState('');
	const [cdaoNo,setCdaoNo]=useState(''); 
	const [buttonState, setButtonState] = useState('');
    const [disabled,setDisabled]=useState(false);
    const [buttonDisabled,setButtonDisabled]=useState(false);
    const [bdVoucher,setBdVoucher]=useState(false);
    const [drr,setDrr]=useState(false);

    const [drrR,setDrrR]=useState('');
    const [drrS,setDrrS]=useState('');
    const [drrApp,setDrrApp]=useState('');



	useEffect(() => {
		let isCancelled = false;
		console.log(id);
		if (id !== 'new') {
			async function fetchData() {
				let record = '';
				await axios.get('/rbsTrans/' + id)
					.then((response) => {
						record = response.data;

						if(record.rentBillSingleRevision==='BDV'){
							setBdVoucher(true);
						}

						if(record.rentBillSingleRevision==='DRR'){
							setDrr(true);
						}
						const fields = [
							'id','dak','employee','cdaoNo', 'checkDigit','cdaSlNo','personelNo','taskNo','rank','name', 'uabsoCode', 'quarterArea',
							'quarterType','buildingNo','station','occupationDate','vacationDate','referenceBillNo','referenceBillDate',
							'occupationVacationRevision','lfeeFromDate','lfeeToDate', 'lfeeAmount','furFromDate','furToDate','furAmount',
							'excessFurFromDate','excessFurToDate','excessFurAmount','fanFromDate','fanToDate','fanAmount','fridgeFromDate',
							'fridgeToDate','fridgeAmount','waterAmount','lightAmount','powerAmount','servantQrAmount','garageAmount','rentBillNo',
							'rentBillDate','batchNo', 'monthEnding','auditorDate','aaoDate','aoDate','reason','recordStatus','remarks','approved',
							'rejectionReason','uploadFileName','rentBillNo','rentBillDate','storesBrief','quantity','rate','bsoBdAmount',
							'approvedBdAmount','drrFromDate','drrToDate','drrRate','drrRent','drrServantGarage','drrAmount','drrBsoAmount'

						];

						setCdaoNo(record.cdaoNo);

						fields.forEach(field => setValue(field, record[field]));


					})

					.catch((error) => {
						//console.log(error);
						//console.log(error.response.status);
						//console.log(error.response.headers);
						if (error.response)
							setServerErrors(error.response.data.error);
						else
							setServerErrors(error.Error);
					});


				if (!isCancelled) {
					setEntity(record);
					setState(prev => ({ ...prev, state: record }));
				}
			}

			fetchData();
			return () => {
				isCancelled = true;
			};
		}


	}, []);

 	useEffect(() => {
		let fetching = false;
		let unmounted = false;
		async function fetchMe() {


				if (!fetching)
					await axios.get(`/miscs/currentMe`)
						.then((response) => {
							setMe(response.data);

						})
						.catch((error) => {
							//console.log(error);
							//console.log(error.response.status);
							//console.log(error.response.headers);
							if (error.response)
								setServerErrors(error.response.data.error);
							else
								setServerErrors(error.Error);
						})
		}
		fetchMe();

		return () => { fetching = true; unmounted = true; }
		// eslint-disable-next-line react-hooks/exhaustive-deps
	}, []);


	const onSubmit = (data, event) => {
		event.preventDefault();
		if(disabled)
			return;

		setDisabled(true);
		setButtonDisabled(true);
		console.log(data);
		if (data.id && bdVoucher===false && drr===false) {
			axios.put("/rbsTrans/" + data.id, data)
				.then((response) => {
					setMesg(response.data);

				})
				.catch((error) => {
					console.log(error);
					//	console.log(error.response.status);
					//	console.log(error.response.headers);
					if (error.response)
						setServerErrors(error.response.data.error);
					else
						setServerErrors(error.Error);
				})
		}else if (data.id && bdVoucher===true) {
			console.log(bdVoucher);
			axios.put("/rbsTrans/bdVoucher/aud/" + data.id, data)
				.then((response) => {
					setMesg(response.data);

				})
				.catch((error) => {
					console.log(error);
					//	console.log(error.response.status);
					//	console.log(error.response.headers);
					if (error.response)
						setServerErrors(error.response.data.error);
					else
						setServerErrors(error.Error);
				})
		}else if (data.id && drr===true) {
			console.log(drr);
			axios.put("/rbsTrans/drr/aud/" + data.id, data)
				.then((response) => {
					console.log("----------values retd----log------:" + response.data);
					setMesg(response.data['remarks']);
					console.log("----------values retd-------:" + response.data['drrRent']);
					setDrrR(response.data['drrRent']);
					setDrrS(response.data['drrServantGarage']);
					setDrrApp(response.data['drrAmount']);

				})
				.catch((error) => {
					console.log(error);
					//	console.log(error.response.status);
					//	console.log(error.response.headers);
					if (error.response)
						setServerErrors(error.response.data.error);
					else
						setServerErrors(error.Error);
				})
		}
		 else {

			axios.post("/rbsTrans", data)
				.then((response) => { 
					console.log(response.data);
					setMesg(response.data);
					setDisabled(false);
				})
				.catch((error) => {
					setMesg(error.response.data);
					//console.log(error.response.data);
 				//	setServerErrors(error.response.data)
				});
		} 


	}

	const onError = (errors, e) => console.log(errors, e);

	//All foreign keys. 
	// XXXXXX Add search fields and adjust the values as necessary
	const parentData = {

		dak: {
			title: "Dak",
			url : "daks",
			searchList : ['id'], //XXXXXXXXX Add search fields
			fkEntity: "dak",
			preload: false, //XXXXXX Set this to true for small tables like designations
		},
			employee: {
			title: "Employee",
			url: "employees/all/effective",
			searchList: ['cdaoNo', 'checkDigit', 'officerName'], //XXXXXXXXX Add search fields
			fkEntity: "employee",
			preload: false, //XXXXXX Set this to true for small tables like designations
		},

	}

	//Callback for child components (Foreign Keys)
	const callback = (childData) => {
		//console.log("Parent Callback");
		setEntity(prev => ({ ...prev, [childData.fk]: childData.entity }));
		setValue(childData.fk, childData.entity);
		//console.log(errors);
		console.log(">>>"+childData.fk);

		clearErrors(childData.fk);
	};

	const errorCallback = (err) => {
		//console.log(err);
		setServerErrors(err);
	}

	const handleInputChange = (e) => {
		//console.log(e.target.value);
	};


	const handleButtonClick = (e) =>{
		history.push("/rbsTrans");
	}

		return (
		<div className="min-h-screen bg-gray-100 text-gray-900">
			<div className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8 pt-4">

				<form onSubmit={handleSubmit(onSubmit, onError)}>
				 {(bdVoucher===false && drr===false) &&

					<h1 >{id === 'new' ? 'Add' : 'Edit'} Single Rent Bill Transaction Edit </h1>
					}

				{console.log(bdVoucher)}
				{bdVoucher===true &&
				<>
					<h1 >{id === 'bdv' ? 'Add' : 'Edit'} Barrack Damage Voucher </h1>
					</>
				}
				{drr===true &&
				<>
					<h1 >{id === 'drr' ? 'Add' : 'Edit'} Damage Rate of Rent </h1>
					</>
				}


					<div className="text-red-500">{mesg}</div>

					<Tabs
						id="InitialOccupationReturnTransactionEdit"
						activeKey={key}
						onSelect={(k) => setKey(k)}
						className="mb-3">

						<Tab eventKey="page1" title="IOR" className="h-120">
							<div className="grid grid-cols-3 gap-0">

								<div>
									<label>Month</label>
